import Vue from 'vue';
import VueRouter from 'vue-router';

// Import your UserPage component
import UserPage from './components/UserPage.vue';

Vue.use(VueRouter);

const routes = [
  // Define your routes here
  {
    path: '/userpage',
    name: 'userpage',
    component: UserPage,
  },
  // Add other routes if needed
];

const router = new VueRouter({
  routes,
  mode: 'history', // This uses HTML5 history mode for cleaner URLs
});

export default router;
